(1304, 1, '2019-10-22 05:04:38', '2019-10-22 05:04:38', '[vc_row][vc_column offset="vc_col-lg-7 vc_col-md-6"][vc_custom_heading text="Introduction" font_container="tag:h2|font_size:24px|text_align:left" use_theme_fonts="yes" font_weight="400" css=".vc_custom_1529488195400{margin-top: 0px !important;margin-bottom: 0px !important;}"][supro_empty_space height="30"][vc_column_text]With ultralight, quality cotton canvas, the JanSport Houston backpack is ideal for a life-on-the-go. This backpack features premium faux leather bottom and trim details, padded 15 in laptop sleeve and tricot lined tablet sleeve[/vc_column_text][supro_empty_space height="55"][vc_custom_heading text="Features" font_container="tag:h2|font_size:24px|text_align:left" use_theme_fonts="yes" font_weight="400" css=".vc_custom_1529488226312{margin-top: 0px !important;margin-bottom: 0px !important;}"][supro_empty_space height="30"][vc_column_text]\n<ul>\n 	<li>Fully padded back panel, web hauded handle</li>\n 	<li>Internal padded sleeve fits 15″ laptop &amp; unique fabric application</li>\n 	<li>Internal tricot lined tablet sleeve</li>\n 	<li>One large main compartment and zippered</li>\n 	<li>Premium cotton canvas fabric</li>\n</ul>\n[/vc_column_text][supro_empty_space height_tablet="40"][/vc_column][vc_column offset="vc_col-lg-5 vc_col-md-6"][vc_single_image image="947" img_size="470x600"][/vc_column][/vc_row]', 'Maleta Azul', 'Maleta tipo BackPack con estilo minimalista elaborada con lino y forro anti fluido. Cuenta con un bolsillo principal, con un compartimiento para laptop de hasta 14 pulgadas, un bolsillo secundario con dos bolsillos internos y porta llaves, dos bolsillos auxiliares a cada lado de la maleta.', 'inherit', 'closed', 'closed', '', '832-autosave-v1', '', '', '2019-10-22 05:04:38', '2019-10-22 05:04:38', '', 832, 'https://versy.wtechnology.co/2019/10/22/832-autosave-v1/', 0, 'revision', '', 0),
