(560, 1, '2018-06-07 08:53:53', '2018-06-07 08:53:53', '[vc_row][vc_column][supro_empty_space height="77"][vc_custom_heading text="Turn Your Followers Into Customers\nWith Instagram Shop" font_container="tag:h2|font_size:36|text_align:center" use_theme_fonts="yes" css=".vc_custom_1528446844134{margin-top: 0px !important;margin-bottom: 0px !important;}"][supro_empty_space height="45"][/vc_column][/vc_row][vc_row][vc_column][vc_column_text]\n<div class="text-center" style="color: #666;">With those things in mind, we decided to take a different path and rethink the way\nproducts and brands reach the attention of prospective buyers. What we found was a staggering shift in the ways\ncustomers used to discover new products in the recent past and the actual ways that\nsame product discovery is happening today.</div>\n[/vc_column_text][/vc_column][/vc_row][vc_row][vc_column][supro_empty_space height="110"][/vc_column][/vc_row][vc_row full_width="stretch_row_content_no_spaces"][vc_column][vc_raw_js][/vc_raw_js][/vc_column][/vc_row]', 'Home Instagram', '', 'publish', 'closed', 'closed', '', 'home-instagram', '', '', '2018-06-07 08:53:53', '2018-06-07 08:53:53', '', 0, 'http://demo3.drfuri.com/supro2/?page_id=560', 0, 'page', '', 0),
