stabilise the brand, which has seen revenue growth owing in part to its high-profile collaboration with Rihanna.[/vc_column_text][supro_empty_space height="90"][/vc_column][vc_column width="2/12"][/vc_column][/vc_row][vc_row][vc_column width="1/2"][vc_single_image image="259" img_size="570x570"][/vc_column][vc_column width="1/2"][vc_single_image image="255" img_size="570x570"][/vc_column][/vc_row][vc_row][vc_column width="2/12"][/vc_column][vc_column width="8/12"][supro_empty_space height="90"][vc_custom_heading text="Learn how to motivate yourself" font_container="tag:h4|font_size:20|text_align:left" use_theme_fonts="yes" css=".vc_custom_1527837706807{margin-top: 0px !important;margin-bottom: 0px !important;}"][supro_empty_space height="38"][vc_column_text]François-Henri Pinault, chief executive officer and chairman, added that the distribution is a “significant milestone" in the company''s history: “Kering dedicating itself entirely to the development of its luxury houses, whose enduring appeal, built on creative audacity and innovativeness, will allow us to continue to gain market share and create value,” he said.[/vc_column_text][supro_empty_space height="38"][vc_custom_heading text="Enhance your life by having a sense of purpose" font_container="tag:h4|font_size:20|text_align:left" use_theme_fonts="yes" css=".vc_custom_1527837731990{margin-top: 0px !important;margin-bottom: 0px !important;}"][supro_empty_space height="38"][vc_column_text]We are proud to have supported the turnaround of Puma, which now has unrivalled capabilities to take full advantage of the specific dynamics of its global markets and is poised to achieve substantial growth.[/vc_column_text][/vc_column][vc_column width="2/12"][/vc_column][/vc_row]</p>\n', 'All of the highlights from Pitti Uomo', 'Horns tooting, Alejandro Gómez Palomo this season put the conservative country set and hunting world through his madcap spinner.', 'publish', 'open', 'open', '', 'all-of-the-highlights-from-pitti-uomo', '', '', '2018-06-01 07:52:15', '2018-06-01 07:52:15', '', 0, 'http://demo2.drfuri.com/supro/?p=280', 0, 'post', '', 0),
