(292, 1, '2018-06-10 08:00:16', '2018-06-10 08:00:16', '<p>[vc_row][vc_column width="2/12"][/vc_column][vc_column width="8/12"][vc_column_text]</p>\n<div class="text-center" style="font-weight: 600;font-size: 20px;color: #222">KERING is distributing 70 percent of its stake in Puma to shareholders in order to focus on its luxury portfolio of brands.</div>\n<p>[/vc_column_text][supro_empty_space height="90"][/vc_column][vc_column width="2/12"][/vc_column][/vc_row][vc_row][vc_column][vc_single_image image="252" img_size="1170x500"][supro_empty_space height="94"][/vc_column][/vc_row][vc_row][vc_column width="2/12"][/vc_column][vc_column width="8/12"][vc_column_text]</p>\n<div style="line-height: 1.9"><span class="cap">K</span>ering’s ambition is to continue to grow and develop its powerful ensemble of houses in couture, leather goods, jewellery and watches, leveraging on its high cash-flow generation and strong financial position, the French luxury goods group, which has Gucci, Saint Laurent, Alexander McQueen, Balenciaga, Christopher Kane and Stella McCartney in its stable, told WWD.</div>\n<p>[/vc_column_text][supro_empty_space height="40"][vc_column_text]The shift will see Kering reduce its stake to 16 percent from 86 percent, with Kering shareholder Artemis winding up with a 29 percent stake in the sports brand, and about 55 percent of Puma’s stock free-floating on the stock market. [/vc_column_text][/vc_column][vc_column width="2/12"][/vc_column][/vc_row][vc_row][vc_column width="2/12"][/vc_column][vc_column width="8/12"][vc_column_text]</p>\n<blockquote><p>When you love fashion, there is no weekend. Everything just blends together.</p></blockquote>\n<p>[/vc_column_text][/vc_column][vc_column width="2/12"][/vc_column][/vc_row][vc_row][vc_column width="2/12"][/vc_column][vc_column width="8/12"][vc_column_text]Jean-Marc Duplaix, Kering’s chief financial officer, said that the group chose not to sell Puma outright in order to avoid a lengthy sale process that would destabilise the brand, which has seen revenue growth owing in part to its high-profile collaboration with Rihanna.[/vc_column_text][supro_empty_space height="90"][/vc_column][vc_column width="2/12"][/vc_column][/vc_row][vc_row][vc_column width="1/2"][vc_single_image image="259" img_size="570x570"][/vc_column][vc_column width="1/2"][vc_single_image image="255" img_size="570x570"][/vc_column][/vc_row][vc_row][vc_column width="2/12"][/vc_column][vc_column width="8/12"][supro_empty_space height="90"][vc_custom_heading text="Learn how to motivate yourself" font_container="tag:h4|font_size:20|text_align:left" use_theme_fonts="yes" css=".vc_custom_1527837706807{margin-top: 0px !important;margin-bottom: 0px !important;}"][supro_empty_space height="38"][vc_column_text]François-Henri Pinault, chief executive officer and chairman, added that the distribution is a “significant milestone" in the company''s history: “Kering dedicating itself entirely to the development of its luxury houses, whose enduring appeal, built on creative audacity and innovativeness, will allow us to continue to gain market share and create value,” he said.[/vc_column_text][supro_empty_space height="38"][vc_custom_heading text="Enhance your life by having a sense of purpose" font_container="tag:h4|font_size:20|text_align:left" use_theme_fonts="yes" css=".vc_custom_1527837731990{margin-top: 0px !important;margin-bottom: 0px !important;}"][supro_empty_space height="38"][vc_column_text]We are proud to have supported the turnaround of Puma, which now has unrivalled capabilities to take full advantage of the specific dynamics of its global markets and is poised to achieve substantial growth.[/vc_column_text][/vc_column][vc_column width="2/12"][/vc_column][/vc_row]</p>\n', 'Five things you only know if you were at Chanel''s Hamburg Show', 'Awards season is in full swing and it would seem that Hollywood’s most stylish are winning in black and white.', 'publish', 'open', 'open', '', 'five-things-you-only-know-if-you-were-at-chanels-hamburg-show', '', '', '2018-06-10 08:00:16', '2018-06-10 08:00:16', '', 0, 'http://demo2.drfuri.com/supro/?p=292', 0, 'post', '', 0),
