(1251, 1, '2019-10-21 17:59:25', '2019-10-21 17:59:25', '<p>[vc_row][vc_column][supro_empty_space height="150" height_tablet="100" height_mobile="50"][/vc_column][/vc_row][vc_row full_width="stretch_row_content_no_spaces"][vc_column el_class="supro-space-left" offset="vc_col-lg-6 vc_col-md-6"][supro_empty_space height="30"][vc_custom_heading text="ABOUT US" font_container="tag:h5|font_size:14|text_align:left" use_theme_fonts="yes" letter_spacing="1px" el_class="primary-color" css=".vc_custom_1522655148377{margin-top: 0px !important;margin-bottom: 14px !important;}"][vc_custom_heading text="Supro is the modern<br />\nluxury shopping<br />\ndestination" font_container="tag:h2|font_size:48|text_align:left" use_theme_fonts="yes" t_supro_heading="" m_supro_heading="" t_font_size="36" css=".vc_custom_1531821832241{margin-top: 0px !important;margin-bottom: 0px !important;}"][supro_empty_space height="60"][vc_row_inner][vc_column_inner offset="vc_col-lg-2 vc_hidden-md vc_hidden-sm vc_hidden-xs"][vc_column_text]</p>\n<div style="background-color: #eaeaea; width: 50px; height: 2px; margin-left: 15px;"></div>\n<p>[/vc_column_text][/vc_column_inner][vc_column_inner offset="vc_col-lg-10 vc_col-md-12"][vc_column_text css=".vc_custom_1522654937411{margin-top: -10px !important;}"]</p>\n<div style="line-height: 1.9;">We started in 2006 and haven''t stopped smashing it<br />\nsince. A global brand that doesn''t sleep, we are 24/7<br />\nand always bringing something new with over 100 new<br />\nproducts dropping on the<br />\nmonhtly, bringing you the latest looks for less.</div>\n<p>[/vc_column_text][/vc_column_inner][/vc_row_inner][supro_empty_space height="0" height_tablet="0" height_mobile="60"][/vc_column][vc_column offset="vc_col-lg-6 vc_col-md-6"][supro_single_image image="328" image_size="845x500" align="right"][/vc_column][/vc_row][vc_row][vc_column][supro_empty_space height="150" height_tablet="100" height_mobile="50"][/vc_column][/vc_row][vc_row][vc_column offset="vc_col-lg-5 vc_col-md-6"][supro_single_image image="329" image_size="470x500"][supro_empty_space height="40"][/vc_column][vc_column offset="vc_col-lg-1 vc_col-md-12"][/vc_column][vc_column offset="vc_col-lg-6 vc_col-md-6"][vc_column_text]</p>\n<blockquote><p>Supro recognises individuality. We see you. We embrace it. We make fashion accessible and fun<cite>Carine Roitfeld</cite><span class="job">Co-Founder</span></p></blockquote>\n<p>[/vc_column_text][supro_empty_space height="17"][vc_column_text]</p>\n<div style="line-height: 1.9;">From over 4 million fans on social and an online magazine,<br />\nwe''re the dress you need at the weekend, and the LOL<br />\nmoments you need when you''re down.</div>\n<p>[/vc_column_text][supro_empty_space height="40"][vc_column_text]</p>\n<div style="background-color: #eaeaea; width: 50px; height: 2px;"></div>\n<p>[/vc_column_text][supro_empty_space height="40"][/vc_column][/vc_row][vc_row][vc_column][supro_empty_space height="95" height_tablet="60" height_mobile="60"][/vc_column][/vc_row][vc_row][vc_column offset="vc_col-lg-6 vc_col-md-6"][vc_custom_heading text="Supro Big Moments" font_container="tag:h2|font_size:48|text_align:left" use_theme_fonts="yes" css=".vc_custom_1521103368831{margin-top: 0px !important;margin-bottom: 20px !important;}"][vc_column_text]</p>\n<div style="line-height: 1.9;">Lorem ipsum dolor sit amet, consectetur adipisicing elit, sed<br />\ndo eiusmod tempor incididunt ut labore et dolore magna<br />\naliqua. Ut enim ad minim veniam, quis nostrud exercitation<br />\nullamco laboris nisi ut aliquip ex ea.</div>\n<p>[/vc_column_text][supro_empty_space height="45"][vc_column_text]</p>\n<div style="background-color: #eaeaea; width: 50px; height: 2px;"></div>\n<p>[/vc_column_text][supro_empty_space height="50" height_tablet="0" height_mobile="0"][/vc_column][vc_column offset="vc_col-lg-6 vc_col-md-6"][vc_row_inner][vc_column_inner offset="vc_col-lg-6 vc_col-md-12"][vc_custom_heading text="2006" font_container="tag:h3|text_align:left" use_theme_fonts="yes" css=".vc_custom_1521103441172{margin-top: 15px !important;margin-bottom: 10px !important;}"][vc_column_text]Supro was born[/vc_column_text][supro_empty_space height="85" height_tablet="30" height_mobile="30"][vc_custom_heading text="2012" font_container="tag:h3|text_align:left" use_theme_fonts="yes" css=".vc_custom_1521103269297{margin-top: 0px !important;margin-bottom: 10px !important;}"][vc_column_text]</p>\n<div style="line-height: 1.9;">We hit 1 mil followers on Facebook<br />\nOpened Sydney office</div>\n<p>[/vc_column_text][supro_empty_space height="0" height_tablet="60" height_mobile="60"][/vc_column_inner][vc_column_inner offset="vc_col-lg-6 vc_col-md-12"][vc_custom_heading text="2009" font_container="tag:h3|text_align:left" use_theme_fonts="yes" css=".vc_custom_1521103446645{margin-top: 15px !important;margin-bottom: 10px !important;}"][vc_column_text]</p>\n<div style="line-height: 1.9;">We went international, lauching in<br />\nLodon and the US.</div>\n<p>[/vc_column_text][supro_empty_space height="50" height_tablet="30" height_mobile="30"][vc_custom_heading text="2015" font_container="tag:h3|text_align:left" use_theme_fonts="yes" css=".vc_custom_1521103275673{margin-top: 0px !important;margin-bottom: 10px !important;}"][vc_column_text]</p>\n<div style="line-height: 1.9;">1000+ employees and we launched<br />\nSupro Premium</div>\n<p>[/vc_column_text][/vc_column_inner][/vc_row_inner][supro_empty_space height="50" height_tablet="0" height_mobile="0"][/vc_column][/vc_row][vc_row][vc_column][supro_empty_space height="100" height_tablet="60" height_mobile="60"][supro_video video="https://vimeo.com/210806753" image="330" image_size="full"]</p>\n<div style="color: #fff; font-size: 30px; line-height: 1.4;">Work hard, have fun</div>\n<div style="color: #fff; font-size: 60px; font-weight: 900; line-height: 1;">NO DRAMA</div>\n<p>[/supro_video][/vc_column][/vc_row][vc_row][vc_column][supro_empty_space height="60" height_tablet="60" height_mobile="60"][supro_icons_box icons="%5B%7B%22icon_type%22%3A%22linearicons%22%2C%22icon_linearicons%22%3A%22icon-location%22%2C%22icon_ionicons%22%3A%22ion-alert%22%2C%22title%22%3A%22FREE%20SHIPPING%22%2C%22desc%22%3A%22Orders%20over%20%24100%22%2C%22link%22%3A%22url%3A%2523%7Ctitle%3AFREE%2520SHIPPING%7C%7C%22%7D%2C%7B%22icon_type%22%3A%22linearicons%22%2C%22icon_linearicons%22%3A%22icon-redo2%22%2C%22icon_ionicons%22%3A%22ion-alert%22%2C%22title%22%3A%22FREE%20RETURNS%22%2C%22desc%22%3A%22Within%2030%20days%22%2C%22link%22%3A%22url%3A%2523%7Ctitle%3AFREE%2520RETURNS%7C%7C%22%7D%2C%7B%22icon_type%22%3A%22linearicons%22%2C%22icon_linearicons%22%3A%22icon-lock%22%2C%22icon_ionicons%22%3A%22ion-alert%22%2C%22title%22%3A%22100%25%20SECURE%22%2C%22desc%22%3A%22Online%20Shopping%22%2C%22link%22%3A%22url%3A%2523%7Ctitle%3A100%2525%2520SECURE%7C%7C%22%7D%2C%7B%22icon_type%22%3A%22linearicons%22%2C%22icon_linearicons%22%3A%22icon-tag%22%2C%22icon_ionicons%22%3A%22ion-alert%22%2C%22title%22%3A%22BEST%20PRICE%22%2C%22desc%22%3A%22Guaranted%22%2C%22link%22%3A%22url%3A%2523%7Ctitle%3ABEST%2520PRICE%7C%7C%22%7D%5D"][supro_empty_space height="90" height_tablet="60" height_mobile="60"][/vc_column][/vc_row][vc_row][vc_column][vc_custom_heading text="Using technology to inspire and innovate, we aim to<br />\nmake shopping seamless, whether online or in store" font_container="tag:h2|font_size:30|text_align:center|line_height:1.6" use_theme_fonts="yes" font_weight="600" css=".vc_custom_1521102465594{margin-top: 0px !important;margin-bottom: 0px !important;}"][/vc_column][/vc_row][vc_row][vc_column][supro_empty_space height="50"][/vc_column][/vc_row][vc_row][vc_column offset="vc_col-lg-1 vc_col-md-12"][/vc_column][vc_column offset="vc_col-lg-5 vc_col-md-6"][vc_column_text]</p>\n<div style="color: #777777;">With over 12 years’ heritage in luxury fashion, we deliver to<br />\nover 170 countries and offer 24/7 advice through MyStylist,<br />\nour dedicated fashion-concierge team</div>\n<p>[/vc_column_text][supro_empty_space height="30"][/vc_column][vc_column offset="vc_col-lg-5 vc_col-md-6"][vc_column_text]</p>\n<div style="color: #777777;">Choose how you want to experience us – online, in our<br />\nLondon stores, at No.23, our private-shopping townhouse,<br />\nor at one of our international events.</div>\n<p>[/vc_column_text][supro_empty_space height="30"][/vc_column][vc_column offset="vc_col-lg-1 vc_col-md-12"][/vc_column][/vc_row][vc_row][vc_column][supro_empty_space height="100" height_tablet="80" height_mobile="60"][/vc_column][/vc_row][vc_row][vc_column][vc_custom_heading text="Leadership Members" font_container="tag:h2|font_size:48|text_align:center" use_theme_fonts="yes" t_supro_heading="" m_supro_heading="" t_font_size="36" css=".vc_custom_1531822213514{margin-top: 0px !important;margin-bottom: 0px !important;}"][supro_empty_space height="90" height_tablet="60" height_mobile="60"][supro_members member_option="%5B%7B%22image%22%3A%22332%22%2C%22image_size%22%3A%22350x350%22%2C%22name%22%3A%22Christine%20McKenazie%22%2C%22job%22%3A%22FOUNDER%22%7D%2C%7B%22image%22%3A%22333%22%2C%22image_size%22%3A%22350x350%22%2C%22name%22%3A%22Lora%20Davidson%22%2C%22job%22%3A%22SALE%20MANAGER%22%7D%2C%7B%22image%22%3A%22334%22%2C%22image_size%22%3A%22350x350%22%2C%22name%22%3A%22Wayne%20Swanson%22%2C%22job%22%3A%22LEAD%20DESIGNER%22%7D%5D"][supro_empty_space height="150" height_tablet="100" height_mobile="50"][/vc_column][/vc_row][vc_row css=".vc_custom_1521100995295{background-color: #fbfbfb !important;}"][vc_column][supro_empty_space height="60"][supro_partner images="335,336,337,338,339,340" effect="" image_size="full" custom_links="#,#,#,#,#,#"][supro_empty_space height="60"][/vc_column][/vc_row][vc_row][vc_column][supro_empty_space height="50"][/vc_column][/vc_row]</p>\n', 'About', '', 'inherit', 'closed', 'closed', '', '311-autosave-v1', '', '', '2019-10-21 17:59:25', '2019-10-21 17:59:25', '', 311, 'https://versy.wtechnology.co/2019/10/21/3