Heschel como regalo, se sorprende y le genera curiosidad el estilo y la calidad de esta pieza, por lo que empieza a indagar sobre el mercado de las maletas en Colombia y llega a la conclusión que el tema del styling es un territorio poco explorado, hallazgo que lo motiva a crear una marca y un producto que junto a su amigo Juanes deciden darle el nombre de Versy.</div>\r\n[/vc_column_text][vc_empty_space height="40px"][vc_custom_heading text="Historia de marca" font_container="tag:h2|font_size:36|text_align:center" use_theme_fonts="yes" t_supro_heading="" m_supro_heading="" css=".vc_custom_1571680830847{margin-top: 0px !important;margin-bottom: 6px !important;}"][vc_empty_space height="40px"][vc_column_text]\r\n<div style="color: #777777;" align="justify">La universidad es nuestro territorio, es el espacio donde converge y se expresa nuestro mercado, por eso usamos la traducción de universidad en inglés (University) y acortamos su escritura.</div>\r\n[/vc_column_text][/vc_column_inner][vc_column_inner width="1/2"][vc_empty_space height="40px"][vc_empty_space height="40px"][vc_images_carousel images="1276,1271" img_size="full" autoplay="yes"][/vc_column_inner][/vc_row_inner][/vc_column][/vc_row][vc_row][vc_column][vc_empty_space height="70px"][vc_custom_heading text="Nuestro Instagram" font_container="tag:h2|font_size:36|text_align:center" use_theme_fonts="yes" t_supro_heading="" m_supro_heading="" css=".vc_custom_1571683608427{margin-top: 0px !important;margin-bottom: 6px !important;}"][vc_empty_space height="70px"][elfsight_instagram_feed id="1"][/vc_column][/vc_row][vc_row el_id="mision"][vc_column][vc_empty_space height="70px"][vc_row_inner][vc_column_inner width="1/2"][vc_images_carousel images="1277,1274" img_size="full" autoplay="yes"][/vc_column_inner][vc_column_inner width="1/2"][vc_custom_heading text="Misión" font_container="tag:h2|font_size:36|text_align:center" use_theme_fonts="yes" t_supro_heading="" m_supro_heading="" css=".vc_custom_1571681301834{marg