suario a través de su producto. Se centra en el cumplimiento de requisitos de los distintos tipos de clientes presentes en el mercado.</div>\r\n<p>[/vc_column_text][/vc_column_inner][vc_column_inner width="1/2"][vc_custom_heading text="Visión" font_container="tag:h2|font_size:36|text_align:center" use_theme_fonts="yes" t_supro_heading="" m_supro_heading="" css=".vc_custom_1571681312802{margin-top: 0px !important;margin-bottom: 6px !important;}"][vc_empty_space height="40px"][vc_column_text]</p>\r\n<div style="color: #777777;" align="justify">Versy en 5 años estará posicionada en Colombia como la marca de mayor impacto diferencial en su experiencia de venta.</div>\r\n<p>[/vc_column_text][/vc_column_inner][/vc_row_inner][/vc_column][/vc_row][vc_row][vc_column][vc_empty_space height="70px"][vc_custom_heading text="Contáctanos" font_container="tag:h2|font_size:36|text_align:center" use_theme_fonts="yes" t_supro_heading="" m_supro_heading="" css=".vc_custom_1571683405945{margin-top: 0px !important;margin-bottom: 6px !important;}"][vc_empty_space height="70px"][supro_instagram user="versy.co" number="8"][/vc_column][/vc_row][vc_row][vc_column][supro_empty_space height="125" height_tablet="80" height_mobile="40"][supro_banner2 height="820" image1="1227" title1="Side Tables" subtitle1="LIVING ROOM" subtitle_color1="#f68872" image2="1228" title2="Vases &amp; Bowls" subtitle2="DECOR" subtitle_color2="#86c178" image3="1229" title3="Knife Sets" subtitle3="KITCHEN" subtitle_color3="#f18cb9" image4="1230" title4="Throw Rugs" subtitle4="BED &amp; BATH" subtitle_color4="#87bbd6"][supro_empty_space height="75" height_tablet="50" height_mobile="50"][/vc_column][/vc_row][vc_row css=".vc_custom_1540525572865{background-color: #ffffff !important;}" el_class="supro-custom-row supro-no-margin"][vc_column][supro_empty_space height="85"][supro_products limit="6" columns="3" orderby="date" order="DESC" category="furniture, bed-bath, lighting, tableware, best-selling" title="New Arrival"][sup