guardia de la moda y brindando una experiencia de usuario a través de su producto. Se centra en el cumplimiento de requisitos de los distintos tipos de clientes presentes en el mercado.</div>\r\n[/vc_column_text][/vc_column_inner][vc_column_inner width="1/2"][vc_custom_heading text="Visión" font_container="tag:h2|font_size:36|text_align:center" use_theme_fonts="yes" t_supro_heading="" m_supro_heading="" css=".vc_custom_1571681312802{margin-top: 0px !important;margin-bottom: 6px !important;}"][vc_empty_space height="40px"][vc_column_text]\r\n<div style="color: #777777;" align="justify">Versy en 5 años estará posicionada en Colombia como la marca de mayor impacto diferencial en su experiencia de venta.</div>\r\n[/vc_column_text][/vc_column_inner][/vc_row_inner][/vc_column][/vc_row][vc_row][vc_column][vc_empty_space height="70px"][vc_custom_heading text="Contáctanos" font_container="tag:h2|font_size:36|text_align:center" use_theme_fonts="yes" t_supro_heading="" m_supro_heading="" css=".vc_custom_1571683405945{margin-top: 0px !important;margin-bottom: 6px !important;}"][vc_empty_space height="70px"][vc_row_inner][vc_column_inner width="2/3"][contact-form-7 id="554"][/vc_column_inner][vc_column_inner width="1/3"][vc_empty_space][supro_socials socials="%5B%7B%22icon_type%22%3A%22fontawesome%22%2C%22icon_fontawesome%22%3A%22fa%20fa-instagram%22%2C%22icon_ionicons%22%3A%22ion-alert%22%2C%22link%22%3A%22url%3Ahttps%253A%252F%252Fwww.instagram.com%252Fversy.co%252F%7C%7C%7C%22%7D%2C%7B%22icon_type%22%3A%22fontawesome%22%2C%22icon_fontawesome%22%3A%22fa%20fa-whatsapp%22%2C%22icon_ionicons%22%3A%22ion-alert%22%2C%22link%22%3A%22url%3Ahttps%253A%252F%252Fapi.whatsapp.com%252Fsend%253Fphone%253D3147806695%2526text%253DHola%7C%7C%7C%22%7D%5D"][vc_empty_space][supro_contact_box display="vertical" phone="+57 314 780 6695" email="versy.co@gmail.com"][/vc_column_inner][/vc_row_inner][/vc_column][/vc_row][vc_row][vc_column][supro_empty_space height="125" height_tablet="80" height_mobil