(1283, 1, '2019-10-21 22:30:56', '2019-10-21 22:30:56', '[vc_row full_width="stretch_row_content_no_spaces"][vc_column][rev_slider_vc alias="home-simple"][/vc_column][/vc_row][vc_row css=".vc_custom_1531388319341{margin-top: -55px !important;}" el_class="supro-no-margin"][vc_column][vc_empty_space height="70px"][supro_icons_box box_shadow="1" icons="%5B%7B%22icon_type%22%3A%22linearicons%22%2C%22icon_linearicons%22%3A%22icon-location%22%2C%22icon_ionicons%22%3A%22ion-alert%22%2C%22title%22%3A%22ENV%C3%8DO%20GRATIS%22%2C%22desc%22%3A%22Pedidos%20de%20m%C3%A1s%20de%20%24100.000%22%7D%2C%7B%22icon_type%22%3A%22linearicons%22%2C%22icon_linearicons%22%3A%22icon-redo2%22%2C%22icon_ionicons%22%3A%22ion-alert%22%2C%22title%22%3A%22DEVOLUCI%C3%93N%20GRATUITA%22%2C%22desc%22%3A%22En%2030%20d%C3%ADas%22%7D%2C%7B%22icon_type%22%3A%22linearicons%22%2C%22icon_linearicons%22%3A%22icon-lock%22%2C%22icon_ionicons%22%3A%22ion-alert%22%2C%22title%22%3A%22100%25%20SEGURO%22%2C%22desc%22%3A%22Online%20Shopping%22%7D%2C%7B%22icon_type%22%3A%22linearicons%22%2C%22icon_linearicons%22%3A%22icon-tag%22%2C%22icon_ionicons%22%3A%22ion-alert%22%2C%22title%22%3A%22MEJOR%20PRECIO%22%2C%22desc%22%3A%22Garantizado%22%7D%5D"][/vc_column][/vc_row][vc_row][vc_column][vc_empty_space height="70px"][vc_custom_heading text="Conoce sobre nosotros" font_container="tag:h2|font_size:36|text_align:center" use_theme_fonts="yes" t_supro_heading="" m_supro_heading="" css=".vc_custom_1571680810091{margin-top: 0px !important;margin-bottom: 6px !important;}"][vc_empty_space height="70px"][vc_row_inner][vc_column_inner width="1/2"][vc_custom_heading text="Historia" font_container="tag:h2|font_size:36|text_align:center" use_theme_fonts="yes" t_supro_heading="" m_supro_heading="" css=".vc_custom_1571680763320{margin-top: 0px !important;margin-bottom: 6px !important;}"][vc_empty_space height="40px"][vc_column_text]\r\n<div style="color: #777777;" align="justify">Camilo al recibir una maleta de la marca Heschel como regalo, se sorprende y le genera curiosidad el estilo y la calidad de esta pieza, por lo que empieza a indagar sobre el mercado de las maletas en Colombia y llega a la conclusión que el tema del styling es un territorio poco explorado, hallazgo que lo motiva a crear una marca y un producto que junto a su amigo Juanes deciden darle el nombre de Versy.</div>\r\n[/vc_column_text][/vc_column_inner][vc_column_inner width="1/2"][vc_custom_heading text="Historia de marca" font_container="tag:h2|font_size:36|text_align:center" use_theme_fonts="yes" t_supro_heading="" m_supro_heading="" css=".vc_custom_1571680830847{margin-top: 0px !important;margin-bottom: 6px !important;}"][vc_empty_space height="40px"][vc_column_text]\r\n<div style="color: #777777;" align="justify">La universidad es nuestro territorio, es el espacio donde converge y se expresa nuestro mercado, por eso usamos la traducción de universidad en inglés (University) y acortamos su escritura.</div>\r\n[/vc_column_text][/vc_column_inner][/vc_row_inner][/vc_column][/vc_row][vc_row][vc_column][vc_empty_space height="70px"][vc_custom_heading text="Nuestro Instagram" font_container="tag:h2|font_size:36|text_align:center" use_theme_fonts="yes" t_supro_heading="" m_supro_heading="" css=".vc_custom_1571683608427{margin-top: 0px !important;margin-bottom: 6px !important;}"][vc_empty_space height="70px"][elfsight_instagram_feed id="1"][/vc_column][/vc_row][vc_row][vc_column][vc_empty_space height="70px"][vc_row_inner][vc_column_inner width="1/2"][vc_custom_heading text="Misión" font_container="tag:h2|font_size:36|text_align:center" use_theme_fonts="yes" t_supro_heading="" m_supro_heading="" css=".vc_custom_1571681301834{margin-top: 0px !important;margin-bottom: 6px !important;}"][vc_empty_space height="40px"][vc_column_text]\r\n<div style="color: #777777;" align="justify">Versy es una empresa que se dedica al diseño, confección y comercialización de maletas de alta calidad, enfocado en la elegancia y sobriedad; estando a la vanguardia de la moda y brindando una experiencia de usuario a través de su producto. Se centra en el cumplimiento de requisitos de los distintos tipos de clientes presentes en el mercado.</div>\r\n[/vc_column_text][/vc_column_inner][vc_column_inner width="1/2"][vc_custom_heading text="Visión" font_container="tag:h2|font_size:36|text_align:center" use_theme_fonts="yes" t_supro_heading="" m_supro_heading="" css=".vc_custom_1571681312802{margin-top: 0px !important;margin-bottom: 6px !important;}"][vc_empty_space height="40px"][vc_column_text]\r\n<div style="color: #777777;" align="justify">Versy en 5 años estará posicionada en Colombia como la marca de mayor impacto diferencial en su experiencia de venta.</div>\r\n[/vc_column_text][/vc_column_inner][/vc_row_inner][/vc_column][/vc_row][vc_row][vc_column][vc_empty_space height="70px"][vc_custom_heading text="Contáctanos" font_container="tag:h2|font_size:36|text_align:center" use_theme_fonts="yes" t_supro_heading="" m_supro_heading="" css=".vc_custom_1571683405945{margin-top: 0px !important;margin-bottom: 6px !important;}"][vc_empty_space height="70px"][vc_row_inner][vc_column_inner width="2/3"][contact-form-7 id="554"][/vc_column_inner][vc_column_inner width="1/3"][vc_empty_space][supro_socials socials="%5B%7B%22icon_type%22%3A%22fontawesome%22%2C%22icon_fontawesome%22%3A%22fa%20fa-instagram%22%2C%22icon_ionicons%22%3A%22ion-alert%22%2C%22link%22%3A%22url%3Ahttps%253A%252F%252Fwww.instagram.com%252Fversy.co%252F%7C%7C%7C%22%7D%2C%7B%22icon_type%22%3A%22fontawesome%22%2C%22icon_fontawesome%22%3A%22fa%20fa-whatsapp%22%2C%22icon_ionicons%22%3A%22ion-alert%22%2C%22link%22%3A%22url%3Ahttps%253A%252F%252Fapi.whatsapp.com%252Fsend%253Fphone%253D3147806695%2526text%253DHola%7C%7C%7C%22%7D%5D"][vc_empty_space][supro_contact_box display="vertical" phone="+57 314 780 6695" email="versy.co@gmail.com"][/vc_column_inner][/vc_row_inner][/vc_column][/vc_row][vc_row][vc_column][supro_empty_space height="125" height_tablet="80" height_mobil