ta de la marca Heschel como regalo, se sorprende y le genera curiosidad el estilo y la calidad de esta pieza, por lo que empieza a indagar sobre el mercado de las maletas en Colombia y llega a la conclusión que el tema del styling es un territorio poco explorado, hallazgo que lo motiva a crear una marca y un producto que junto a su amigo Juanes deciden darle el nombre de Versy.</div>\r\n[/vc_column_text][vc_empty_space height="40px"][vc_custom_heading text="Historia de marca" font_container="tag:h2|font_size:36|text_align:center" use_theme_fonts="yes" t_supro_heading="" m_supro_heading="" css=".vc_custom_1571680830847{margin-top: 0px !important;margin-bottom: 6px !important;}"][vc_empty_space height="40px"][vc_column_text]\r\n<div style="color: #777777;" align="justify">La universidad es nuestro territorio, es el espacio donde converge y se expresa nuestro mercado, por eso usamos la traducción de universidad en inglés (University) y acortamos su escritura.</div>\r\n[/vc_column_text][/vc_column_inner][vc_column_inner width="1/2"][vc_empty_space height="70px"][vc_images_carousel images="1271,1276" img_size="full" autoplay="yes"][/vc_column_inner][/vc_row_inner][/vc_column][/vc_row][vc_row el_id="instagram"][vc_column][vc_empty_space height="140px"][vc_custom_heading text="Nuestro Instagram" font_container="tag:h2|font_size:36|text_align:center" use_theme_fonts="yes" t_supro_heading="" m_supro_heading="" css=".vc_custom_1571683608427{margin-top: 0px !important;margin-bottom: 6px !important;}"][vc_empty_space height="70px"][elfsight_instagram_feed id="1"][/vc_column][/vc_row][vc_row el_id="mision"][vc_column][vc_empty_space height="140px"][vc_row_inner][vc_column_inner width="1/2"][vc_images_carousel images="1274,1277" img_size="full"][/vc_column_inner][vc_column_inner width="1/2"][vc_custom_heading text="Misión" font_container="tag:h2|font_size:36|text_align:center" use_theme_fonts="yes" t_supro_heading="" m_supro_heading="" css=".vc_custom_1571681301834{margin-top: 0px !important;margin-bottom: 6px !important;}"][vc_empty_space height="40px"][vc_column_text el_id="vision"]\r\n<div style="color: #777777;" align="justify">Versy es una empresa que se dedica al diseño, confección y comercialización de maletas de alta calidad, enfocado en la elegancia y sobriedad; estando a la vanguardia de la moda y brindando una experiencia de usuario a través de su producto. Se centra en el cumplimiento de requisitos de los distintos tipos de clientes presentes en el mercado.</div>\r\n[/vc_column_text][vc_empty_space height="60px"][vc_custom_heading text="Visión" font_container="tag:h2|font_size:36|text_align:center" use_theme_fonts="yes" t_supro_heading="" m_supro_heading="" css=".vc_custom_1571681312802{margin-top: 0px !important;margin-bottom: 6px !important;}"][vc_empty_space height="40px"][vc_column_text]\r\n<div style="color: #777777;" align="justify">Versy en 5 años estará posicionada en Colombia como la marca de mayor impacto diferencial en su experiencia de venta.</div>\r\n[/vc_column_text][vc_empty_space height="60px"][vc_single_image image="1279" img_size="medium" alignment="center"][/vc_column_inner][/vc_row_inner][/vc_column][/vc_row][vc_row el_id="contacto"][vc_column width="1/3"][vc_empty_space height="130px"][vc_zigzag][/vc_column][vc_column width="1/3"][vc_single_image image="1258" img_size="medium" alignment="center"][/vc_column][vc_column width="1/3"][vc_empty_space height="130px"][vc_zigzag][/vc_column][/vc_row][vc_row][vc_column][vc_empty_space height="70px"][vc_custom_heading text="Contáctanos" font_container="tag:h2|font_size:36|text_align:center" use_theme_fonts="yes" t_supro_heading="" m_supro_heading="" css=".vc_custom_1571683405945{margin-top: 0px !important;margin-bottom: 6px !important;}"][vc_empty_space height="70px"][vc_row_inner][vc_column_inner width="2/3"][contact-form-7 id="554"][/vc_column_inner][vc_column_inner width="1/3"][vc_empty_space][supro_socials socials="%5B%7B%22icon_type%22%3A%22fontawesome%22%2C%22ic