(1, 'Supro Nav Dark', 'supro-nav-dark', 'arrows', '.supro-nav-dark.tparrows {\n	background: transparent;\n    width: 70px\n}\n\n.supro-nav-dark:before {\n	display: none;\n}\n\n.supro-nav-dark .supro-arrow {\n	color: #222222;\n    position: absolute;\n    top: 50%;\n    left: 50%;\n    transform: translate(-50%,-50%);\n    transition: 0.5s;\n    width: 100%;\n    text-align: left;\n    display: flex;\n    align-items: center;\n    justify-content: space-between;\n}\n\n.supro-nav-dark .supro-arrow.right-arrow {\n	text-align: right;\n} \n\n.supro-nav-dark i {\n	font-size: 30px;\n}\n\n.supro-nav-dark .arrow-label {\n	font-size: 12px;\n    font-weight: 700;\n    opacity: 0;\n    transition: 0.5s;\n    display: inline-block;\n}\n\n.supro-nav-dark:hover .arrow-label {\n	opacity: 1;\n}\n\n.supro-nav-dark.tp-leftarrow .right-arrow{\n	display: none;\n}\n\n.supro-nav-dark.tp-rightarrow .left-arrow{\n	display: none;\n}', '<div class=\\"supro-arrow right-arrow\\">\n	<span class=\\"arrow-label\\">NEXT</span>\n	<i class=\\"icon-arrow-right\\"></i>\n</div>\n<div class=\\"supro-arrow left-arrow\\">\n	<i class=\\"icon-arrow-left\\"></i>\n    <span class=\\"arrow-label\\">PREV</span>\n</div>\n', '{"dim":{"width":"160","height":"160"},"placeholders":{},"presets":{},"version":"6.0.0"}'),
(2, 'Supro Nav Dark', 'supro-nav-dark', 'bullets', '.supro-nav-dark .tp-bullet {\n	width: 8px;\n    height: 8px;\n    background-color: transparent;\n    border-radius: 50%;\n    border: 1px solid #bbbbbb;\n    transition: 0.5s;\n}\n\n.supro-nav-dark .tp-bullet.selected,\n.supro-nav-dark .tp-bullet:hover {\n	border-color: #222;\n    background-color: #222;\n}', '<span class=\\"tp-bullet-image\\"></span>\n<span class=\\"tp-bullet-title\\"></span>', '{"dim":{"width":"160","height":"160"},"placeholders":{},"presets":{},"version":"6.0.0"}'),
(3, 'Supro Nav Dark', 'supro-nav-dark', 'tabs', '.supro-nav-dark.nav-pos-hor-right {\n	text-align: right;\n}\n\n.supro-nav-dark .tp-tab-number,\n.supro-nav-dark .tp-tab-title {\n	font-weight: 400;\n    color: #bbbbbb;\n    transition: 0.5s\n}\n\n.supro-nav-dark .tp-tab-number {\n	font-size: 13px;\n}\n\n.supro-nav-dark .tp-tab-title {\n	font-weight: 700;\n    font-size: 18px;\n}\n\n.supro-nav-dark .tp-tab {\n	opacity: 1;\n    padding: 20px 0;\n}\n\n.supro-nav-dark .tp-tab:after {\n	content: \\''\\'';\n    position: absolute;\n    bottom: 0;\n    right: 0;\n    width: 20px;\n    height: 1px;\n    background-color: #bbbbbb;\n}\n\n.supro-nav-dark .tp-tab:last-child:after {\n	display: none;\n}\n\n.supro-nav-dark .tp-tab.selected .tp-tab-number,\n.supro-nav-dark .tp-tab:hover .tp-tab-number,\n.supro-nav-dark .tp-tab.selected .tp-tab-title,\n.supro-nav-dark .tp-tab:hover .tp-tab-title {\n	color: #222;\n}', '<div class=\\"tp-tab-number\\">{{param1}}</div>\n<div class=\\"tp-tab-title\\">{{title}}</div>', '{"dim":{"width":"160","height":"160"},"placeholders":{},"presets":{},"version":"6.0.0"}');
